import React from 'react';
import { Draggable } from 'react-beautiful-dnd';

export default function Task({ task }){
  return (
    <Draggable
      draggableId={task.id}
      index={index}
    >
      <div 
        style={{
          border: `1px solid lightgrey`,
          borderRadius: `2px`,
          padding: `8px`,
          marginBottom: `8px`
        }}
      >
        {task.content}
      </div>
    </Draggable>
  );
}
